import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for at least one "Add to Cart" button to appear (use text selector for robustness)
    await page.waitForSelector('button:has-text("Add to Cart")', { timeout: 10000 });

    // Find all visible Add to Cart buttons (use text selector)
    const addToCartButtons = await page.$$('button:has-text("Add to Cart")');

    // Rapidly click Add to Cart on all visible products (simulate stress test)
    let clickCount = 0;
    for (const btn of addToCartButtons) {
      // Only click if enabled and visible
      if (await btn.isVisible() && !(await btn.isDisabled())) {
        await btn.click();
        clickCount++;
        // Wait a short time to simulate rapid user (not instant, but fast)
        await page.waitForTimeout(100);
      }
    }

    // Take screenshot after adding all products
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_add_all.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_add_all.png'));

    // Open cart - use text selector for "Cart" or cart icon/div
    // Try to click the cart div (contains text "Cart")
    const cartDiv = await page.$('div.cart');
    if (cartDiv) {
      await cartDiv.click();
    } else {
      // Fallback: try to click a button or link with "Cart"
      const cartBtn = await page.$('button:has-text("Cart"),a:has-text("Cart")');
      if (cartBtn) await cartBtn.click();
    }

    // Wait for cart modal/dialog to appear (look for "Proceed to Checkout" button)
    await page.waitForSelector('button:has-text("Proceed to Checkout")', { timeout: 8000 });

    // Take screenshot of cart after stress add
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_opened.png'));

    // Remove items rapidly: find all "Remove" buttons in cart and click them quickly
    // Use text selector for "Remove"
    let removeButtons = await page.$$('button:has-text("Remove")');
    let removedCount = 0;
    for (const btn of removeButtons) {
      if (await btn.isVisible() && !(await btn.isDisabled())) {
        await btn.click();
        removedCount++;
        await page.waitForTimeout(80);
      }
    }

    // Wait a bit for cart to update
    await page.waitForTimeout(800);

    // Take screenshot after removals
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_after_removal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_after_removal.png'));

    // Extract cart count from cart icon/div (should be 0 or empty)
    let cartCountText = '';
    const cartCountElem = await page.$('div.cart');
    if (cartCountElem) {
      cartCountText = (await cartCountElem.textContent() || '').replace(/\s+/g, ' ').trim();
    }

    // Extract any message about empty cart
    let emptyCartMsg = '';
    const emptyCartElem = await page.$('text=Your cart is empty');
    if (emptyCartElem) {
      emptyCartMsg = await emptyCartElem.textContent();
    }

    return {
      success: true,
      action: `Rapidly added ${clickCount} products to cart, then removed ${removedCount} items for stress test.`,
      extractedData: {
        cartCountText,
        emptyCartMsg,
        addClicks: clickCount,
        removeClicks: removedCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
